const Mailer = () =>{
    return(
        <div className="container border "
        style={{
                width:'50%',
                margin: 'auto',
                marginTop:"60px",
                backgroundImage:`url('https://images.unsplash.com/photo-1566073771259-6a8506099945?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8aG90ZWwlMjBib29raW5nfGVufDB8fDB8fA%3D%3D&auto=format&fit=crop&w=500&q=60')`}}>
            <h1> Booking Form </h1>
            <form>
                <label>Name</label>
                <input type='text' name='name'/>
                <label>Email</label>
                <input type='eamil' name='user_email'/>
                <label>Message</label>
                <textarea name='message' rows='4'/>
                <input type='submit' value='Send' />
            </form>
        </div>
    );
}
export default Mailer ;
